import React from 'react'
import Layout from "../common/Layout";
import './appreciation.css'
import Appreciation from '../components/Certificates/appreciation'

const Error = () => {
    return (
        <Layout>
            <Appreciation 
            imgSrc='https://www.actfl.org/sites/default/files/assessments/Opi%20tester%20certificate%20sample.jpg'
            title='EVS Professional Training Institute'
            
            />
        </Layout>


    )
}

export default Error;
